import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
const Card = () => {
  const [products, setProducts] = useState([]);
  useEffect(() => {
    const fetchData = async () => {
      const data = await axios.get("/products");
      setProducts(data);
    };
    fetchData();
  }, []);
  return <>{products}</>;
};

export default Card;
